  computed: {
    prepareData: function() {
      let data = {
        id: "facicare",
        name: "FaciCare App",
        creatingDate: this.getCurrentDateTime(),
        description: "Đồ án chuyên ngành - đừng xóa"
      };
      return data;
    }
  },
  methods: {
    // helper functions
    getCurrentDateTime: function() {
      let today = new Date();
      let hours = today.getHours();
      let minutes = today.getMinutes();
      let seconds = today.getSeconds();
      let years = today.getFullYear();
      let months = today.getMonth() + 1;
      let days = today.getDate();

      if (hours < 10) {
        hours = "0" + hours;
      }
      if (minutes < 10) {
        minutes = "0" + minutes;
      }
      if (seconds < 10) {
        seconds = "0" + seconds;
      }
      if (months < 10) {
        months = "0" + months;
      }
      if (days < 10) {
        days = "0" + days;
      }

      let time = hours + ":" + minutes + ":" + seconds;
      let date = years + "/" + months + "/" + days;
      return date + " " + time;
    },
    prepareTechnicianData: function(item) {
      let record = {
        id: item.id,
        creatingDate: this.getCurrentDateTime(),
        description: "Đây là thông tin kỹ thuật viên được tạo từ CRM",
        bucket: "crm_app_technician",
        content: item.content,
        createdByDevice: "facicare"
      };
      return record;
    },
    prepareServiceData: function(item) {
      let record = {
        id: item.id,
        creatingDate: this.getCurrentDateTime(),
        description: "Đây là thông tin dịch vụ được tạo từ CRM",
        bucket: "crm_app_service",
