        bucket: "crm_app_company",
        content: item.content,
        createdByDevice: "facicare"
      };
      return record;
    },
    prepareTreeQueryData: function(item) {
      let record = {
        id: item.id,
        creatingDate: this.getCurrentDateTime(),
        description: "Đây là thông tin đơn vị hành chính được tạo từ CRM",
        bucket: "crm_app_donvihanhchinh",
        content: item.content,
        createdByDevice: "facicare"
      };
      return record;
    },

    // function setup device
    setupDevice: function() {
      let data = this.prepareData;
      let record = data.id;
      let serverDomain = this.$store.getters.getServerDomain;
      let api = "/api/core/v1/device/create" + "/" + record;
      let url = serverDomain + api;
      let config = {
        headers: this.$store.getters.getAuthConfig
      };

      // call api create device
      axios
        .post(url, data, config)
        .then(response => {
          console.log("Device " + record + " is created");
        })
        .catch(e => {
          console.log("Failed to create device " + record);
        });
    },

    // function setup bucket
    setupBucket: function() {
      for (let i = 0; i < this.bucketData.length; i++) {
        let data = {
          name: this.bucketData[i].name,
          description: this.bucketData[i].description,
          created_by_user: this.bucketData[i].createdByUser,
          created_by_device: this.bucketData[i].createdByDevice,
          creatingDate: this.bucketData[i].creatingDate
        };
        let bucket = this.bucketData[i].id;
        let serverDomain = this.$store.getters.getServerDomain;
        let api = "/api/core/v1/bucket/create" + "/" + bucket;
        let url = serverDomain + api;
        let config = {
          headers: this.$store.getters.getAuthConfig
        };

        // call api create device
        axios
          .post(url, data, config)
          .then(response => {
            this.countCreatedBucket += 1;
            console.log("Bucket " + bucket + " is created");
          })
          .catch(e => {
            console.log("Failed to create bucket " + bucket);
          });
      }
    },

